package com.terasoft.terautils.urlImgConvertor;

import static org.hamcrest.CoreMatchers.*;
import static org.junit.Assert.*;
import org.junit.Test;


public class UrlImgConvTest {

	
	@Test
	public void testConvertImgOnDiskToBase64() throws Exception {
		ClassLoader classLoader = getClass().getClassLoader();
		String url = "file://"+classLoader.getResource("tiger.jpg").getPath();
		String exp = "";
		
		UrlImgConv img = new UrlImgConv(url);
		String imgb64 = img.toB64();
		
		assertThat(imgb64,is(equalTo(exp)));
	}

	@Test
	public void testConvertImgOnWebToBase64_jpg() throws Exception {
		String url = "http://www.hdwallpapersimages.com/wp-content/uploads/2014/01/Winter-Tiger-Wild-Cat-Images.jpg";
		String exp = "";
		
		UrlImgConv img = new UrlImgConv(url);
		String imgb64 = img.toB64();
		
		assertThat(imgb64,is(equalTo(exp)));
	}
	
	@Test
	public void testConvertImgOnWebToBase64_png() throws Exception {
		String url = "http://www.fordesigner.com/imguploads/Image/cjbc/zcool/png20080526/1211808819.png";
		String exp = "";		
		
		UrlImgConv img = new UrlImgConv(url);
		String imgb64 = img.toB64();
		
		assertThat(imgb64,is(equalTo(exp)));
	}	

	@Test
	public void testConvertImgOnWebToBase64_gif() throws Exception {
		String url = "http://www.openbsd.org/art/puffy/ppuf1000X907.gif";
		String exp = "";		
		
		UrlImgConv img = new UrlImgConv(url);
		String imgb64 = img.toB64();
		System.out.println(img.toB64DataUri());
		assertThat(imgb64,is(equalTo(exp)));
	}	
			
}
